(5, 'ở Aura District', '/banner/motngay.png', '8pm', 'Thưởng thức một bản nhạc “chill” tại nhà hàng. Rôm rả với những câu chuyện bất tận. Kết thúc một ngày tràn đầy niềm vui và cảm hứng.', '/banner/banner2.png', '2019-09-23 13:09:42', NULL);

