(1, 'Căn hộ cơ bản của bạn có gì?', '<div class=\"item_drs_dichvu\"><img src=\"/storage/app/media/uploaded-files/icon-tien-nghi.png\" alt=\"\" class=\"fr-fic fr-dii\">\r\n\r\n	<p>Tiện nghi: máy lạnh, nước lọc, khu đậu xe, lau dọn và và giặt ủi</p>\r\n</div>\r\n<div class=\"item_drs_dichvu\"><img src=\"/storage/app/media/uploaded-files/icon-cong-nghe.png\" alt=\"\" class=\"fr-fic fr-dii\">\r\n\r\n	<p>Công nghệ: internet, cổng sạc USB, TV&nbsp;</p>\r\n</div>\r\n<div class=\"item_drs_dichvu\"><img src=\"/storage/app/media/uploaded-files/icon-tien-ich.png\" alt=\"\" class=\"fr-fic fr-dii\">\r\n\r\n	<p>Tiện ích: gym, hồ bơi, hoạt động cộng đồng, khu vực ngoài trời&nbsp;</p>\r\n</div>\r\n<div class=\"item_drs_dichvu\"><img src=\"/storage/app/media/uploaded-files/icon-hon-hop.png\" alt=\"\" class=\"fr-fic fr-dii\">\r\n\r\n	<p>Hỗn hợp: cho thuê, camera, dọn rác, khu tái chế</p>\r\n</div>', '2019-09-23 13:15:54', '2019-09-23 06:15:54'),
(2, 'Các dịch vụ nâng cấp khác', '<div class=\"item_drs_dichvu\"><img src=\"/storage/app/media/uploaded-files/icon-noi-that.png\" alt=\"\" class=\"fr-fic fr-dii\">\r\n\r\n	<p>Nội thất thông minh: + tiết kiệm không gian + bàn ghế đa chức năng + kho lưu trữ ẩn náu</p>\r\n</div>\r\n<div class=\"item_drs_dichvu\"><img src=\"/storage/app/media/uploaded-files/icon-dieu-khien.png\" alt=\"\" class=\"fr-fic fr-dii\">\r\n\r\n	<p>Hệ điều khiển thông minh: + điều khiển giọng nói + ổ khóa tự động + tự động tiết kiệm điện</p>\r\n</div>\r\n<div class=\"item_drs_dichvu\"><img src=\"/storage/app/media/uploaded-files/icon-tich-hop.png\" alt=\"\" class=\"fr-fic fr-dii\">\r\n\r\n	<p>Tích hợp hệ sinh thái của App thành viên + điều khiển nội thất phòng + sắp xếp lịch hẹn</p>\r\n</div>', '2019-09-23 06:49:50', '2019-09-22 23:49:50');

