INSERT INTO `aura_backend_faq` (`id`, `title`, `content`, `created_at`, `updated_at`) VALUES
(1, 'Làm thế nào để đăng kí sử dụng dịch vụ tại Aura Co-living? Giá phòng 1 tháng tại Aura? Tôi có được xem trước phòng hoặc share phòng với bạn bè không?', 'Qui trình đăng kí sử dụng dịch vụ hiện chưa có. Giá phòng 1 tháng tại Aura là 3,5tr bao gồm điện nước, chưa bao gồm phí gửi xe. Bạn sẽ được tham quan phòng trước khi đặt và Aura rất tiếc là bạn không thể share phòng với bạn bè, vì 1 phòng tại Aura được thiết kế riêng biệt cho 1 người dùng giúp tối ưu sự riêng tư.', '2019-09-18 21:48:33', '2019-09-18 21:48:33'),
(2, 'Tôi có phải đặt cọc trước nếu book phòng tại Aura Coliving không? Chế độ hủy đặt phòng của Aura co-living như thế nào?', 'Đối với khách ở dài hạn, nếu muốn book phòng tại Aura, bạn sẽ phải đặt cọc trước 2 tháng tiền phòng (7 triệu). Đối với khách ở ngắn hạn, bạn không cần đặt cọc khi book phòng. Chế độ hủy đặt phòng chưa có', '2019-09-18 21:48:44', '2019-09-18 21:48:44'),
(3, 'Chế độ trả phòng của Aura co-living như thế nào?', 'Đối với khách ở dài hạn, bạn phải thông báo trước 1 tháng nếu muốn check-out. Đối với khách ở ngắn hạn, bạn phải check-out trước 14h.', '2019-09-18 21:48:55', '2019-09-18 21:48:55'),
(4, 'Những giấy tờ hành chính để chuyển vào Aura co-living?', 'Đối với khách hàng lưu trú ngắn hạn, chỉ cần cmnd/passport để check-in. Đối với khách hàng lưu trú dài hạn, cần cung cấp cmnd/passport và giấy đăng kí tạm vắng tại địa phương', '2019-09-18 21:49:07', '2019-09-18 21:49:07'),
(5, 'Các hình thức thanh toán tại Aura.  Hướng dẫn thanh toán trực tuyến tại Aura', 'Có 4 hình thức thanh toán tại Aura\r\n-Thanh toán bằng thẻ ngân hàng\r\n-Thanh toán bằng tiền mặt\r\n-Thanh toán qua app của Aura\r\n-Thanh toán qua ví điện tử của Aura', '2019-09-18 21:49:28', '2019-09-18 21:49:28'),
(6, 'Có gì khác biệt giữa Aura co-living và các hình thức cư trú khác? Vd: homestay, khách sạn giá rẻ, phòng trọ, kí túc xá...', 'Khi là thành viên Aura, bạn sẽ sở hữu không gian nghỉ ngơi riêng tư tuyệt đối. Bạn còn có thể sử dụng không gian co-working rộng rãi, đầy đủ tiện nghi của Aura để làm việc. Ngoài ra, Aura còn tổ chức các buổi hội thảo, workshop, các lớp kĩ năng, lớp học nhảy, yoga để bạn học hỏi và giảm stress. Chúng mình còn phát triển Aura app giúp bạn theo dõi những sự kiện hay ho diễn ra trong ngày, đặt chỗ ở các buổi hội thảo, thanh toán các dịch vụ tại Aura.', '2019-09-18 21:49:43', '2019-09-18 21:49:43'),
(7, 'Aura Co-living có app không? Cách sử dụng như thế nào?', 'Aura Co-living có phát triển app mang tên Aura District', '2019-09-18 21:50:20', '2019-09-18 21:50:20'),
(8, 'Không gian sự kiện Aura bao gồm những gì?', 'Không gian sự kiện ở Aura có thiết kế trang nhã, ở ngay vị trí trung tâm. Aura cung cấp cho bạn tất cả các thiết bị tổ chức sự kiện cần thiết như máy chiếu, màn hình, micrô hoặc bộ công cụ. Nếu bạn cần dữ liệu hình ảnh cho sự kiện của mình, Aura sẽ kết nối bạn với các nhà quay phim và nhiếp ảnh gia chuyên nghiệp giúp bạn ghi lại những khoảnh khắc đáng nhớ trong sự kiện. Bạn yên tâm, các chi phí ở Aura đều minh bạch. Bất kì ai cũng có thể đặt ngay không gian tổ chức sự kiện tại Aura. Sự năng động, không gian thiết kế tốt có thể được đặt bất cứ lúc nào cho các sự kiện công cộng cũng như riêng tư. Tất cả các không gian đều có khả năng tùy biến cao giúp bạn tùy chỉnh không gian phù hợp với yêu cầu riêng. Nếu bạn cần không gian để tổ chức sự kiện, Aura là lựa chọn tuyệt vời cho bạn', '2019-09-18 21:50:43', '2019-09-18 21:50:43');

